IF OBJECT_ID('dbo.proc_transform_185', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_185;
GO
CREATE PROCEDURE dbo.proc_transform_185
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_185
    SET payload = LEFT(payload, 1000) + N'|V4-185|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_185;
END
